  return (
    <div className="cart">
      <h1>Your Cart</h1>
      <div className="carts-container">
        <CartItem />
      </div>
      <div className="check-out">
        <p>All Items</p>
        <div className="cart-info">
          <p>06</p>
          <p>$444</p>
          <span>CHECK OUT ALL</span>
        </div>
      </div>
    </div>
  );
}

export default Cart;
